      error: null,
      isLoaded: false,
      items: {}
    };
  }
  componentDidMount() {
    // get all entities - GET
   fetch("https://jsonplaceholder.typicode.com/posts", {
      "method": "GET",
   
    })
    .then(response => response.json())
   .then(response => {
      this.setState({
       friends: response
      })
      console.log(this.state.friends)
   })
   
    .catch(err => { console.log(err); 
    });
    console.log(this.state.friends)
  }
  render() {
   
